import React from "react";
import { Link } from "react-router-dom";

const HomeyModule = () => {
  return (
    <div>
      <Link to="/register">
        <button>Register</button>
      </Link>
      <p>lolololol</p>
      <br />
      <br />
      <Link to="/login">
        <button>Login</button>
      </Link>
    </div>
  );
};

export default HomeyModule;
